import React from "react";
import "./Video.css";

const Video = () => {
  return (
    <div className="video">
      <video
        className="video_player"
        loop
        src="http://commondatastorage.googleapis.com/gtv-videos-bucket/sample/BigBuckBunny.mp4"
      ></video>
    </div>
  );
};

export default Video;
